// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract LogTestContract {
    // Defin struktru priek urnla ieraksta
    struct Log {
        uint256 eventId; // Notikuma ID
        string message; // Ziojums
        string timeCreated; // Izveidoanas laiks
        string levelDisplayName; // Lmea nosaukums
        string providerName; // Piegdtja nosaukums
    }

    // Privts masvs, kas satur visus urnla ierakstus
    Log[] private logs;

    // Funkcija, kas saglab urnla ierakstu
    function saglabatZurnalu(
        uint256 eventId, // Notikuma ID
        string memory message, // Ziojums
        string memory timeCreated, // Izveidoanas laiks
        string memory levelDisplayName, // Lmea nosaukums
        string memory providerName // Piegdtja nosaukums
    ) public {
        // Pievieno jaunu urnla ierakstu masvam
        logs.push(Log(eventId, message, timeCreated, levelDisplayName, providerName));
    }

    // Funkcija, kas mekl urnla ierakstus pc notikuma ID
    function mekletPecId(uint256 eventId) public view returns (Log[] memory) {
        uint256 count = 0;
        
        // Skaita cik urnla ieraksti atbilst dotajam notikuma ID
        for (uint256 i = 0; i < logs.length; i++) {
            if (logs[i].eventId == eventId) {
                count++;
            }
        }

        // Izveido jaunu masvu rezulttu glabanai
        Log[] memory result = new Log[](count);
        uint256 index = 0;
        
        // Pievieno atbilstoos urnla ierakstus rezulttu masvam
        for (uint256 i = 0; i < logs.length; i++) {
            if (logs[i].eventId == eventId) {
                result[index] = logs[i];
                index++;
            }
        }

        // Atgrie rezulttu masvu
        return result;
    }
}
